css:
atom-text-editor .gutter .line-number.split-diff-added,
atom-text-editor::shadow .gutter .line-number.split-diff-added,
atom-text-editor .line.split-diff-added,
atom-text-editor::shadow .line.split-diff-added {
  background-color: rgba(181, 191, 130, 0.4);
}
atom-text-editor .gutter .line-number.split-diff-removed,
atom-text-editor::shadow .gutter .line-number.split-diff-removed,
atom-text-editor .line.split-diff-removed,
atom-text-editor::shadow .line.split-diff-removed {
  background-color: rgba(226, 120, 120, 0.4);
}
atom-text-editor .gutter .line-number.split-diff-selected,
atom-text-editor::shadow .gutter .line-number.split-diff-selected,
atom-text-editor .line.split-diff-selected,
atom-text-editor::shadow .line.split-diff-selected {
  background-color: rgba(226, 165, 120, 0.4);
}
atom-text-editor .split-diff-word-added .region,
atom-text-editor::shadow .split-diff-word-added .region {
  background-color: rgba(181, 191, 130, 0.5);
}
atom-text-editor .split-diff-word-removed .region,
atom-text-editor::shadow .split-diff-word-removed .region {
  background-color: rgba(226, 120, 120, 0.5);
}
atom-text-editor .split-diff-offset,
atom-text-editor::shadow .split-diff-offset {
  background-color: #2b335a;
}
.split-diff-modal {
  padding: 14px;
  text-align: center;
}
.split-diff-message {
  font-size: 26px;
  display: inline-block;
}
.split-diff-icon {
  background-image: url('images/octocat-spinner-128.gif');
  background-repeat: no-repeat;
  background-size: contain;
  width: 40px;
  height: 40px;
  display: inline-block;
}
.split-diff-hide-mask:after {
  display: none;
}
.git-time-machine .timeplot .placeholder {
  height: 100px;
  text-align: center;
  vertical-align: middle;
}
.git-time-machine .close-handle {
  position: absolute;
  top: 3px;
  right: 4px;
  border: 1px solid #BBB;
  display: inline-block;
  border-radius: 14px;
  /* background-color: red; */
  font-size: 13px;
  margin-right: 12px;
  margin-top: 4px;
  cursor: pointer;
  z-index: 4;
}
.git-time-machine .close-handle:hover {
  background-color: red;
}
.git-time-machine .stats {
  display: inline-block;
  float: left;
  margin-top: 3px;
}
.git-time-machine .axis path,
.git-time-machine .axis line {
  fill: none;
  stroke: #eee;
  shape-rendering: crispEdges;
}
.git-time-machine .axis text {
  font-family: sans-serif;
  font-size: 11px;
  fill: #6b6b6b;
}
.git-time-machine .loading {
  font-family: sans-serif;
  font-size: 15px;
}
.git-time-machine .circle {
  fill: #ffffff;
  opacity: .3;
}
.git-time-machine .hover-marker {
  position: absolute;
  height: calc(100% - 25px);
  width: 5px;
  top: 0px;
  right: 10px;
  background-color: transparent;
}
.git-timemachine-popup {
  background: #111111;
  color: #aaaaaa;
}
.git-timemachine-popup.popover-list {
  position: absolute;
  z-index: 10;
  width: 400px;
  max-height: 300px;
  overflow-y: auto;
  border: solid 4px transparent;
}
.git-timemachine-popup .controls {
  float: right;
}
.git-timemachine-popup ul {
  list-style-type: none;
}
.git-timemachine-popup li .commit {
  background-color: #0a0a0a;
  margin-left: -35px;
  margin-bottom: 4px;
  padding: 3px 4px;
  white-space: pre-wrap;
}
.git-timemachine-popup li .commit:hover {
  background-color: #ff3236;
}
.git-timemachine-popup li .commit > div {
  margin-bottom: 4px;
}
.git-timemachine-popup li .commit .header {
  width: 100%;
  overflow: hidden;
}
.git-timemachine-popup li .commit .header > div {
  display: inline-block;
  width: 30%;
}
